swaptrade_modal_desc_crosschain_valuedif:
Las comisiones que se consideran en la diferencia en el valor de esta transacción bridge son las siguientes:
• Comisión del bridge cross-chain: {bridgePriceAndFee}
• Comisión de red en la cadena de destino: {toChainPriceAndFee}

Cuando tradeas una cierta cantidad de tokens, esto afecta la profundidad del pool de liquidez y, a su vez, cambia la disponibilidad general y el precio de los tokens, lo que ocasiona diferencias notables en los precios.

