swaptrade_mid_dialog_desc_est_network_fe:
En las transacciones bridge, esta comisión incluye las comisiones de red tanto para la red de origen como para el bridge cross-chain.

La comisión de esta transacción está compuesta por:
· Comisión de red {chain}: {value1}
· Comisión de red del bridge {bridge}: {value2}

No cobramos comisiones de red porque son pagos para los mineros.

swaptrade_intro_dialog_desc_cross_value_:
La diferencia en el valor de esta transacción se muestra de la siguiente manera:
· {chain} Comisión de red: {value1}
· {bridge} Comisión del bridge: {value2}

Si la diferencia en el valor es mucho mayor mientras que las comisiones arriba indicadas son relativamente pequeñas, se debe a que el monto del bridge afectó la profundidad del pool de liquidez de este par de tokens.

swaptrade_intro_tooltip_trade_including_:
En las transacciones bridge, el costo incluye la comisión de red de la red de pago y una parte de las comisiones del bridge cross-chain. Desglose de comisiones de esta transacción:
• Comisión de red: {fromChainPriceAndFee}
• Comisión de bridge cross-chain: {bridgePriceAndFee}
La comisión de red cubre los costos de los mineros y no la cobra nuestra plataforma.

